import ColoredButton from './components/ColoredButton'
import styled from 'styled-components'
import './App.css'

const TitleStyle = styled.h1`
  color: 'Blue';
  text-align: center;
`

function App() {
  return (
    <div className="App">
      <TitleStyle>My colored button</TitleStyle>
      <ColoredButton />
    </div>
  )
}

export default App
